"     50 mcg/mL (1 mL): $11.92",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     100 mcg/mL (1 mL): $23.11",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     200 mcg/mL (5 mL): $238.28",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     500 mcg/mL (1 mL): $111.48",
"    </p>",
