"   </div>",
"   <div class=\"block mop drugH1Div\" id=\"F1792867\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Monitoring Parameters",
"    </span>",
"    <p style=\"text-indent:-2em;margin-left:2em;\">",
"     Acromegaly: Growth hormone, somatomedin C (IGF-1)",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;\">",
"     Carcinoid: 5-HIAA, plasma serotonin and plasma substance P",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;\">",
"     VIPomas: Vasoactive intestinal peptide",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;\">",
"     Chronic therapy: Thyroid function (baseline and periodic), vitamin B",
"     <sub>",
"      12",
"     </sub>",
"     level, blood glucose, glycemic control and antidiabetic regimen (patients with diabetes mellitus), cardiac function (heart rate, ECG), zinc level (patients with excessive fluid loss maintained on TPN)",
"    </p>",
"   </div>",
"   <div class=\"block rer drugH1Div\" id=\"F202930\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Reference Range",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Vasoactive intestinal peptide: &lt;75 ng/L; levels vary considerably between laboratories",
"    </p>",
"   </div>",
"   <div class=\"list fbnlist drugH1Div drugBrandNames\" id=\"F2869399\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     International Brand Names",
"    </span>",
"    <ul>",
"     <li>",
"      Cryostatin (MX);",
"     </li>",
"     <li>",
"      Nomactril (MX);",
"     </li>",
"     <li>",
"      Octide (TW);",
"     </li>",
"     <li>",
"      Octride (CO, EC, TH);",
"     </li>",
"     <li>",
"      Proclose (MX);",
"     </li>",
"     <li>",
"      Sandostatin (AE, AR, AT, AU, BD, BG, BH, BR, CH, CL, CN, CY, CZ, DE, DK, EE, EG, ES, FI, GB, GR, HK, HN, ID, IE, IL, IN, IQ, IR, JO, JP, KP, KW, LB, LY, MT, MY, NO, NZ, OM, PE, PH, PK, PL, PY, QA, RU, SA, SE, SG, SK, SY, TH, TR, TW, UY, VE, YE);",
"     </li>",
"     <li>",
"      Sandostatin LAR (AR, AU, BG, BR, CH, CN, EC, EE, ID, IL, KP, MY, NO, NZ, PE, PH, SE, SG, TH, TW, UY);",
"     </li>",
"     <li>",
"      Sandostatina (IT, MX, PT);",
"     </li>",
"     <li>",
"      Sandostatina LAR (CO);",
"     </li>",
"     <li>",
"      Sandostatine (BE, FR, NL)",
"     </li>",
"    </ul>",
"   </div>",
"   <div class=\"block pha drugH1Div\" id=\"F202918\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Mechanism of Action",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Mimics natural somatostatin by inhibiting serotonin release, and the secretion of gastrin, VIP, insulin, glucagon, secretin, motilin, and pancreatic polypeptide. Decreases growth hormone and IGF-1 in acromegaly. Octreotide provides more potent inhibition of growth hormone, glucagon, and insulin as compared to endogenous somatostatin. Also suppresses LH response to GnRH, secretion of thyroid-stimulating hormone and decreases splanchnic blood flow.",
"    </p>",
"   </div>",
"   <div class=\"block phk drugH1Div\" id=\"F202935\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Pharmacodynamics/Kinetics",
"    </span>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Duration: SubQ: 6-12 hours",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Absorption: SubQ: Rapid and complete; I.M. (depot formulation): Released slowly (via microsphere degradation in the muscle)",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Distribution: V",
"     <sub>",
"      d",
"     </sub>",
"     : 14 L (13-30 L in acromegaly)",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Protein binding: 65%, primarily to lipoprotein (41% in acromegaly)",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Metabolism: Extensively hepatic",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Bioavailability: SubQ: 100%; I.M: 60% to 63% of SubQ dose",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Half-life elimination: 1.7-1.9 hours; Increased in elderly patients; Cirrhosis: Up to 3.7 hours; Fatty liver disease: Up to 3.4 hours; Renal impairment: Up to 3.1 hours",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Time to peak, plasma: SubQ: 0.4 hours (0.7 hours acromegaly); I.M.: 1 hour",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Excretion: Urine (32% as unchanged drug)",
"    </p>",
"   </div>",
