var title_f42_7_43130="ECG digoxin toxicity in AF 1";
var content_f42_7_43130=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=CARD%2F64396%7ECARD%2F76154%7ECARD%2F55119%7ECARD%2F66940&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=7\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=CARD%2F64396%7ECARD%2F76154%7ECARD%2F55119%7ECARD%2F66940&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=7\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic2\" style=\"width: 1128px;\">",
"  <div class=\"figure\" style=\"width: 558px\">",
"   <div class=\"ttl\">",
"    Single-lead electrocardiogram (ECG) showing atrial fibrillation (AF) with junctional escape beats suggesting digoxin toxicity",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 538px; height: 80px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    The 4 electrocardiograms in this sequence demonstrate increasing severity of digoxin toxicity in a patient with atrial fibrillation.",
"    <br>",
"     <br>",
"      This ECG shows atrial fibrillation with an irregularly irregular ventricular response. However, the longest recurring R-R intervals are constant, suggesting junctional escape beats due to AV nodal block. The escape interval of 680 msec indicates an accelerated automatic pacemaker with a rate of 88 beats/min.",
"      <div class=\"footnotes\">",
"      </div>",
"      <div class=\"reference\">",
"       The four electrocardiograms are adapted from Childers, R, Med Clin North Am 1976; 60:3.",
"      </div>",
"     </br>",
"    </br>",
"   </div>",
"  </div>",
"  <div class=\"figure\" style=\"width: 450px\">",
"   <div class=\"ttl\">",
"    Normal rhythm strip",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 432px; height: 165px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Normal rhythm strip in lead II. The PR interval is 0.15 sec and the QRS duration is 0.08 sec. Both the P and T waves are upright.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Morton F Arnsdorf, MD.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic2\" style=\"width: 1126px;\">",
"  <div class=\"figure\" style=\"width: 556px\">",
"   <div class=\"ttl\">",
"    Single-lead electrocardiogram (ECG) showing atrial fibrillation with an accelerated junctional pacemaker",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 536px; height: 79px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    The 4 electrocardiograms in this sequence demonstrate increasing severity of digoxin toxicity in a patient with atrial fibrillation.",
"    <br>",
"     <br>",
"      In this strip, the R-R intervals are constant, as the ventricles are controlled by an accelerated junctional pacemaker, resulting in a regular tachycardia at 115 beats per minute. Physical examination at this time might lead to the erroneous diagnosis of a regular sinus mechanism.",
"      <div class=\"footnotes\">",
"      </div>",
"      <div class=\"reference\">",
"       The four electrocardiograms are adapted from Childers, R, Med Clin North Am 1976; 60:3.",
"      </div>",
"     </br>",
"    </br>",
"   </div>",
"  </div>",
"  <div class=\"figure\" style=\"width: 450px\">",
"   <div class=\"ttl\">",
"    Normal rhythm strip",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 432px; height: 165px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Normal rhythm strip in lead II. The PR interval is 0.15 sec and the QRS duration is 0.08 sec. Both the P and T waves are upright.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Morton F Arnsdorf, MD.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic2\" style=\"width: 1127px;\">",
"  <div class=\"figure\" style=\"width: 557px\">",
"   <div class=\"ttl\">",
"    Single-lead electrocardiogram (ECG) showing atrial fibrillation with further accelerated junctional pacemaker",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 537px; height: 131px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    The 4 electrocardiograms in this sequence demonstrate increasing severity of digoxin toxicity in a patient with atrial fibrillation.",
"    <br>",
"     <br>",
"      In this strip, the R-R intervals remain constant with&nbsp;further acceleration of the junctional pacemaker to a rate of 142 beats per minute.",
"      <div class=\"footnotes\">",
"      </div>",
"      <div class=\"reference\">",
"       The four electrocardiograms are adapted from Childers, R, Med Clin North Am 1976; 60:3.",
"      </div>",
"     </br>",
"    </br>",
"   </div>",
"  </div>",
"  <div class=\"figure\" style=\"width: 450px\">",
"   <div class=\"ttl\">",
"    Normal rhythm strip",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 432px; height: 165px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Normal rhythm strip in lead II. The PR interval is 0.15 sec and the QRS duration is 0.08 sec. Both the P and T waves are upright.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Morton F Arnsdorf, MD.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic2\" style=\"width: 1129px;\">",
"  <div class=\"figure\" style=\"width: 559px\">",
"   <div class=\"ttl\">",
"    Single-lead electrocardiogram (ECG) showing atrial fibrillation and a junctional pacemaker with a 4:3 Wenckebach exit block",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 539px; height: 76px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    The 4 electrocardiograms in this sequence demonstrate increasing severity of digoxin toxicity in a patient with atrial fibrillation.",
"    <br>",
"     <br>",
"      In this strip, the result is group beating characterized by three beats with decreasing R-R intervals. On physical examination, this seemingly irregular rhythm might lead to the mistaken diagnosis of an irregularly irregular response to atrial fibrillation, rather than arrhythmia associated with severe digoxin toxicity. This patient presented with this ECG; the preceding electrocardiograms reflected (in reverse order) the sequence of recovery as the effect of digoxin wore off.",
"      <div class=\"footnotes\">",
"      </div>",
"      <div class=\"reference\">",
"       The four electrocardiograms are adapted from Childers, R, Med Clin North Am 1976; 60:3.",
"      </div>",
"     </br>",
"    </br>",
"   </div>",
"  </div>",
"  <div class=\"figure\" style=\"width: 450px\">",
"   <div class=\"ttl\">",
"    Normal rhythm strip",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 432px; height: 165px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Normal rhythm strip in lead II. The PR interval is 0.15 sec and the QRS duration is 0.08 sec. Both the P and T waves are upright.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Morton F Arnsdorf, MD.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
