var title_f42_7_43132="Short acting beta agonists adult";
var content_f42_7_43132=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ALLRG%2F62770&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ALLRG%2F62770&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Short-acting inhaled beta agonists for asthma treatment in adults",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <colgroup span=\"3\" width=\"33%\">",
"     </colgroup>",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Drug",
"       </td>",
"       <td class=\"subtitle1\">",
"        Formulation",
"       </td>",
"       <td class=\"subtitle1\">",
"        Adult dose",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"3\">",
"        Albuterol",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Proventil-HFA, Ventolin-HFA, ProAir-HFA",
"       </td>",
"       <td>",
"        MDI: 90 mcg/puff",
"       </td>",
"       <td>",
"        2 puffs every 4 to 6 h PRN*",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" rowspan=\"4\">",
"        Albuterol solution",
"       </td>",
"       <td class=\"sublist1_start\">",
"        Nebulizer solution:",
"       </td>",
"       <td rowspan=\"4\">",
"        1.25 to 2.5 mg every 4 to 6 h PRN",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        1.25 mg per 3 mL unit dose (0.042%)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        2.5 mg per 3 mL unit dose (0.083%)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        2.5 mg per 0.5 mL solution (0.5%) to be diluted to a total volume of 3 mL",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"3\">",
"        Levalbuterol",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Xopenex-HFA",
"       </td>",
"       <td>",
"        MDI: 45 mcg/puff",
"       </td>",
"       <td>",
"        2 puffs every 4 to 6 h PRN*",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" rowspan=\"3\">",
"        Xopenex",
"       </td>",
"       <td class=\"sublist1_start\" colspan=\"2\">",
"        Nebulizer solutions:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        0.63 mg/3 mL unit dose",
"       </td>",
"       <td class=\"sublist_other\">",
"        0.63 mg every 6 to 8 h PRN",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        1.25 mg/3 mL unit dose",
"       </td>",
"       <td class=\"sublist_other\">",
"        1.25 mg every 8 h PRN",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"3\">",
"        Pirbuterol",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" rowspan=\"2\">",
"        Maxair Autohaler",
"       </td>",
"       <td>",
"        Breath-actuated",
"       </td>",
"       <td rowspan=\"2\">",
"        2 puffs every 4 to 6 h PRN*",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        MDI: 200 mcg/puff",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"3\">",
"        Albuterol sulfate with ipratropium bromide",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Combivent MDI",
"       </td>",
"       <td>",
"        MDI: 90 mcg albuterol + 18 mcg ipratropium/puff",
"       </td>",
"       <td>",
"        2 puffs every 4 to 6 h PRN*",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Albuterol with ipratropium solution",
"       </td>",
"       <td>",
"        Nebulizer solution: 2.5 mg albuterol with 0.5 mg ipratropium/3 mL",
"       </td>",
"       <td>",
"        3 mL every 6 h PRN",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    Metered dose inhaler (MDI) doses are expressed as the actuator dose (the amount of drug leaving the actuator and delivered to the patient), which is the labeling required in the United States. This is different from the dose expressed as the valve dose (the amount of drug leaving the valve, not all of which is available to the patient), which is used in many European countries and in some of the scientific literature.",
"    <br/>",
"    Generic albuterol-HFA is available in some countries outside the United States.",
"    <br/>",
"    The international name of albuterol is salbutamol.",
"    <br/>",
"    The international name of levalbuterol is levosalbutamol.",
"    <div class=\"footnotes\">",
"     MDI: metered dose inhaler; HFA: hydrofluoroalkane; PRN: as needed; h: hour; %: percent.",
"     <br/>",
"     * Short-acting beta agonists can also be administered 10 to 15 minutes prior to exercise.",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
var script_f42_7_43132=[""].join("\n");
